import { useState, useEffect } from "react";


export default function Vans() {
  const [vans, setVans] = useState([]);
  useEffect(() => {
    async function getVans() {
      fetch('api/vans')
      .then(res => res.json())
      .then(data => setVans(data.vans))
    }
  }, []);

  return (
    <h1>Hello World</h1>
  );
};
